/**
 * @file ubc/duration/appear
 * @module log
 * @author wangyongqing <wangyongqing01@baidu.com>
 */

import register from '../register';
import {getParams} from '../utils';
import log from './index';
register('ubc/duration/appear', {
    v: 4,
    hasCB: false,
    versionRange: ['8.3'],
    androidliteVersionRange: ['2.2.2'],
    androidmissionVersionRange: ['1.0'],
    iosmissionVersionRange: ['1.0'],
    androidinfoVersionRange: ['1.0'],
    notSupportFrame: {
        android: ['search']
    }
});
/**
 * ubc/duration/appear
 * @function appear
 * @param {object} [data={}] - ubc 参数
 */
export default (data = {}) =>
    log(
        getParams('durationAppear', {
            data,
            abtest: data.abtest
        })
    );
